		"text": "해외결제는 원래 소득공제 제외대상입니다. 앱스토어도 국내 게임사 아니면 대부분은 안되고, 된다도 원래 직접 문의해야 한다네요(다른 카드들도). 너무 놀라지 마시고 카카오페이 계속 쓰세요. 혹시 모르니 현금영수증 설정 체크 하시구요. https://t.co/tDLfwItloM"
