		"text": "그리고 공동구매에 대해서.\n\n예전에는 개인이 공동구매를 진행하거나 했지만 지금은 사이트내 별도페이지 (쇼핑몰에서 개인결제를 만드는 것처럼 제공하거나 아예 공개를 해서 진행) 하는 방식으로 하기 때문에 개인정보나 먹튀 걱정은 거의 사라졌다."
