		"text": "발명자인 기후현 이나가키 류우키(15)는 2019년 발생한 교토 애니메이션 방화사건이 이번 발명을 하게 된 계기라고 이야기 하며 도망치던 사람들이 방범창에 막혀 죽은것을 보고 왜 사람을 살리기 위한 방범창이 사람을 죽이게 되는것인가 고민한 결과라고 코멘트."
